Let $X_n$ be the number of balls in urn A at time $n$ for $n = 0,1,...,N$. Then, for $k=1,2,...,N-1$ and $n=0,1,...$,
\begin{align*}
X_n 
&= k,\\
\Pr\{X_{n+1} = k - 1 | X_n = k\} 
&= (\frac{N-k}{N}) \cdot p,\\
\Pr\{X_{n+1} = k|X_n = k\} 
&= (\frac{k}{N}) \cdot p + (\frac{N-k}{N}) \cdot q, \text{and} \\
\Pr\{X_{n+1} = k + 1|X_n = k\} 
&= (\frac{k}{N}) \cdot q 
\end{align*}
For $k = 0$, $X_n = 0$, urn B must be chosen. Although urn A may be selected to take out one ball, urn A is empty and therefore number of balls in urn A and urn B will remain 0 and N respectively. It is like the end of the process, and we called this 'ending' state ($X_n = 0$) as '\textit{absorbing state}'. The corresponding transition probabilities are    
\begin{align*}
\Pr\{X_{n+1} = - 1 | X_n = 0 \} 
&= 0\\
\Pr\{X_{n+1} = 0 | X_n = 0 \} 
&= 1\\
\Pr\{X_{n+1} = 1 | X_n = 0 \} 
&= 0
\end{align*}
Similarly, for $k = N$, $X_n = N$ urn A must be chosen. It is another absorbing state with transition probabilities 
\begin{align*}
\Pr\{X_{n+1} = N - 1 | X_n = N \} 
&= 0\\
\Pr\{X_{n+1} = N | X_n = N \} 
&= 1\\
\Pr\{X_{n+1} = N + 1 | X_n = N \} 
&= 0
\end{align*}
Therefore, the desired transition probability matrix is:
 \[
 \mathbf{P} = 
 \begin{array}{l}
 \begin{array}{lllllll}
 \hspace{0.175cm} & \ \ \ \ \ \ \ \ \ 0 \ & \hspace{0.125cm} \ \ \ \ \ \ \ \ \ \  \ \ \ \ \ \ \ \ \ \ 1 \ \  & \hspace{0.2cm} \ \ \ \ \ \ \ \ \ \  \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ \ 2 \ \  & \hspace{0.175cm} \ \ \ \ \ \ \ \ \ \ \ \cdots & N-1 & N \\
 \end{array}\\
