    (\frac{N-1}{N}) \cdot p & (\frac{1}{N}) \cdot p + (\frac{N-1}{N}) \cdot q & (\frac{1}{N}) \cdot q & \cdots & \ \ \ 0 & \ \ \ \ \ 0 \ \ \\ 
