Now we have our generating function $\phi(s)$ for the two steps transition, note to run over all the outcomes, the summation is $\sum_k=\sum_{k_1}\sum_{i=0}^{k_1}$
\begin{align*}
\phi(s)=\sum_kP(k)s^k&=\sum_{k_1}\sum_{i=0}^{k_1}s^{\sum_{i=0}^{k_1}k_{2,i}}{\xi}_1(k_1)\prod_{i=0}^{k_1}{\xi}_2(k_{2,i})\\
&=\sum_{k_1}{\xi}_1(k_1)\sum_{i=0}^{k_1}\prod_{i=0}^{k_1}{\xi}_2(k_{2,i})s^{k_{2,i}}
\end{align*}
Since each term have element $\prod_{i=0}^{k_1}{\xi}_2(k_{2,i})s^{k_{2,i}}$ and we have to run over all possible outcomes $k$ (usually come from multiplication of series), it is natural to think of $g^{k_1}$.<br>
