\end{align*}
Therefore, the extinction probability is $f\circ g(u_{\infty})$

Let $X_n$ be the number of tails at the end of period $n$. Then, $\{X_n\}$ is a Markov chain with state $ \{0, 1, 2, 3, 4, 5\} $. \\ \\
If 0 tail appears in the previous toss, the process will be ended. So it is an absorbing state:
\begin{align*}
\Pr\{X_1 = 0 | X_0 = 0\} &= 1\\
\Pr\{X_1 = 0 | X_0 \neq 0\} &= 0\\
\end{align*}
If 1 tail appears in the previous toss, 0 or 1 tail will appear in this toss where both probabilities are 1/2:
\begin{align*}
\Pr\{X_1 = 0 | X_0 = 1\} &= \frac{1}{2} = \Pr\{X_1 = 1 | X_0 = 1\} \\
\Pr\{X_1 = 0 | X_0 \neq 0 \ \text{or} \  1 \} &= 0\\
\end{align*}
If 2 tails appear in the previous toss, 0, 1 or 2 tail(s) will appear in this toss where the probabilities are 1/4, 1/2 and 1/4 respectively:
\begin{align*}
\Pr\{X_1 = 0 | X_0 = 2\} &= \frac{1}{4} = \Pr\{X_1 = 2 | X_0 = 2\} \\
\Pr\{X_1 = 1 | X_0 = 2\} &= \frac{1}{2}\\
\Pr\{X_1 = 0 | X_0 \neq 0, 1 \ \text{or} \  2 \} &= 0\\
\end{align*}
If 3 tails appear in the previous toss, 0, 1, 2 or 3 tail(s) will appear in this toss where the probabilities are 1/8, 3/8, 3/8 and 1/8 respectively:
\begin{align*}
\Pr\{X_1 = 0 | X_0 = 3\} &= \frac{1}{8} = \Pr\{X_1 = 3 | X_0 = 3\} \\
\Pr\{X_1 = 1 | X_0 = 3\} &= \frac{3}{8} = \Pr\{X_1 = 2 | X_0 = 3\}\\
\Pr\{X_1 = 0 | X_0 \neq 0, 1, 2 \ \text{or} \  3 \} &= 0\\
\end{align*}
If 4 tails appear in the previous toss, 0, 1, 2, 3, 4 tail(s) will appear in this toss where the probabilities are 1/16, 1/4, 3/8, 1/4 and 1/16 respectively:
\begin{align*}
\Pr\{X_1 = 0 | X_0 = 4\} &= \frac{1}{16} = \Pr\{X_1 = 4 | X_0 = 4\} \\
\Pr\{X_1 = 1 | X_0 = 4\} &= \frac{1}{4} = \Pr\{X_1 = 3 | X_0 = 4\}\\
\Pr\{X_1 = 2 | X_0 = 4\} &= \frac{3}{8}\\
\Pr\{X_1 = 0 | X_0 = 5\} &= 0\\
\end{align*}
If 5 tails appear in the previous toss, 0, 1, 2, 3, 4 or 5 tail(s) will appear in this toss where the probabilities are 1/32, 5/32, 5/16, 5/16, 5/32 and 1/32 respectively:
\begin{align*}
\Pr\{X_1 = 0 | X_0 = 5\} &= \frac{1}{32} = \Pr\{X_1 = 5 | X_0 = 5\} \\
\Pr\{X_1 = 1 | X_0 = 5\} &= \frac{5}{32} = \Pr\{X_1 = 4 | X_0 = 5\}\\
\Pr\{X_1 = 2 | X_0 = 5\} &= \frac{5}{16} = \Pr\{X_1 = 3 | X_0 = 5\}\\
\end{align*}
