fields.problem:
Let $X(t)$ be a Poisson process of rate $\lambda$. Calculate the joint probability
density function for waiting times
\begin{equation*}
\text{Pr}\{W_1=w_1,W_2=w_2\}=f(w_1,w_2)
\end{equation*}
Hint: Consider Pr$\{W_1>w_1,W_2>w_2\}$ first and take derivative to get the probability density function.

fields.solutions:
Recall the identity $\{W_n\leq t\}=\{X(t)\geq n\}$, so $\{W_1>w_1,W_2>w_2\}=\{X(w_1)<1,X(w_2)<2\}=\{X(w_1)=0,X(w_2)=0 \text{ or } 1\}$ <br>
As we know $W_1$ and $W_2$ are independent (i.i.d Sojourn time), Pr$\{X(w_1)=0,X(w_2)=0 \text{ or } 1\}$=Pr$\{X(w_1)=0\}$Pr$\{X(w_2)=0 \text{ or } 1\}$.
\begin{equation*}
\text{Pr}\{X(w_1)=0\}\text{Pr}\{X(w_2)=0 \text{ or } 1\}=e^{-\lambda w_1}(e^{-\lambda(w_2-w_1)}+\lambda(w_2-w_1)e^{-\lambda(w_2-w_1)}/1!)=e^{-\lambda w_2}+\lambda(w_2-w_1)e^{-\lambda(w_2-w_1)}
\end{equation*}
The above expression is the joint upper tail probability, which can be treated as the cumulative joint distribution. To get $f(w_1,w_2)$ we take $\frac{\partial^2}{\partial_{w_1}\partial_{w_2}}$. In the end, we get 
\begin{equation*}
f(w_1,w_2)=\lambda^2e^{-\lambda w_2}
\end{equation*}

