&= \frac{\partial^2}{\partial w_1 \ \partial w_2}  \left\lbrace  
e^{-\lambda_0 w_2} + \frac{\lambda_0}{\lambda_1 - \lambda_0} e^{-\lambda_0 w_2} + \frac{\lambda_0}{\lambda_0 - \lambda_1} e^{-\left[ \lambda_1(w_2 - w_1) +\lambda_0 w_1 \right]}
 \right\rbrace \\
&= \frac{\partial^2}{\partial w_1 \ \partial w_2}  \left\lbrace  
