\right\rbrace \\
&= \frac{\partial}{\partial w_1}  \left\lbrace  
- \frac{\lambda_0 \lambda_1}{\lambda_1 - \lambda_0} e^{-\lambda_0 w_2} - \frac{\lambda_0 \lambda_1}{\lambda_0 - \lambda_1} e^{-\left[ \lambda_1(w_2 - w_1) +\lambda_0 w_1 \right]}
\right\rbrace \\
