fields.problem:
Derive $P_n(t)$ when all birth parameters are the same constant $\lambda$ using the iterative form of marginal distribution
\begin{equation*}
P_n(t)=\lambda_{n-1}e^{-\lambda_nt}\int_0^te^{\lambda_n x}P_{n-1}(x)dx
\end{equation*}

fields.solutions:
Exploit the first few terms
