P_2(t)&=\lambda^2 e^{-\lambda t}\int_0^te^{\lambda t}e^{-\lambda t}t dt=\frac{(\lambda t)^2}{2}e^{-\lambda t}\\
\vdots\\
\end{align*}
You can see the exponential terms always being cancelled out inside the integral. We are actually doing the operation
\begin{equation*}
\lambda \int_0^t\qquad dt
